import { createTheme, ThemeProvider } from '@mui/material/styles';
import React from 'react';
import './order.css';
const theme = createTheme({
  palette: {
    primary: {
      light: '#474747',
      main: '#474747',
      dark: '#002884',
      contrastText: '#fff',
    },
    secondary: {
      light: '#474747',
      main: '#474747',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});

const Upload = () => {
  return (
    <ThemeProvider theme={theme}>
      <div className='order-form-container'>
        <div className='order-head'>Upload Your Design</div>
      </div>
    </ThemeProvider>
  );
};

export default Upload;
